import React from 'react';
import headerLogoPath from "../images/logo/logo-mesto.svg";

function Header() {
    return (
        <>
            <header className="header">
                <a href="../../public/index.html">
                    <img
                        className="header__logo"
                        src={headerLogoPath}
                        alt="Mesto логотип"
                    />
                </a>
            </header>
        </>
    );
};

export default Header;
